content:
i decided to fact check this myself and those numbers are technically correct based on averages. hate crimes kept going up, then peaked in October 2023, then _plummeted_ by December. even at that peak they weren't pandemic-levels, which were the highest peak in hate crimes in the past 10 years based on data. so, even though they've overall increased, looks like they're still declining, thanks to news reports! so good news is, even though they went up on average, they're starting to decline again.

other than that, it's pretty accurate. almost everything went down. in fact i'd argue some of those went down by _more._

except vehicle thefts. for some reason. those went up 12.6%. [here's the sauce](https://cde.ucr.cjis.gov/LATEST/webapp/#/pages/home)
